import { UserService } from './services/user.service';
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.scss'],
})
export class RegisterComponent implements OnInit {
  constructor(private userService: UserService) {}
  ngOnInit(): void {
    this.userService.getUsers$.subscribe((x) => {
      console.log(x);
    });
  }
}
<div class=" h-screen">
  <div class=" bg-slate-50 ">
    <div class="px-16 flex justify-between p-10">

      <div>
        <h1 class="text-4xl text-blue-900 my-4 ">Welcome to <span class="fw-bold text-6xl">Matcher</span>
        </h1>
        <h3 class="text-blue-600 text-2xl my-3 ">Let's connect !</h3>

        <div class="bg-white rounded-md p-4 text-slate-500">
          <h1 class="font-semibold text-center my-3">Sign with your credential !</h1>
          <div class="text-center">
            <button class="border border-slate-100  p-2">
              Sign In
            </button>
            <button class="bg-white border border-slate-100 p-2">
              Create Account
            </button>
          </div>
          <div class="mt-3">
            <input type="text" class="border rounded-sm" placeholder="Username">
          </div>
        </div>
      </div>
      <img src="../../../assets/images/register-bg.svg" class="w-1/2 aspect-video md:aspect-square">
    </div>



  </div>

</div>
